#
# TABLE STRUCTURE FOR: barang_keluar_details
#

DROP TABLE IF EXISTS `barang_keluar_details`;

CREATE TABLE `barang_keluar_details` (
  `bk_details_id` bigint(20) unsigned NOT NULL,
