#
# TABLE STRUCTURE FOR: stokminimal
#

DROP TABLE IF EXISTS `stokminimal`;

CREATE ALGORITHM=UNDEFINED DEFINER=`spr123`@`%` SQL SECURITY DEFINER VIEW `stokminimal` AS select sum(`invoice_details`.`quantity`) AS `totalSalesQnty`,sum(`product_purchase_details`.`quantity`) AS `totalPurchaseQnty`,`product_information`.`stock_start` AS `stock_start`,`product_information`.`stokmin` AS `stokmin`,`product_information`.`product_id` AS `product_id`,`product_information`.`product_name` AS `product_name`,`product_information`.`unit` AS `unit`,`product_information`.`size` AS `size`,`product_category`.`category_name` AS `category_name` from (((`product_information` left join `product_category` on(`product_category`.`category_id` = `product_information`.`category_id`)) left join `product_purchase_details` on(`product_purchase_details`.`product_id` = `product_information`.`product_id`)) left join `invoice_details` on(`invoice_details`.`product_id` = `product_information`.`product_id`)) where `invoice_details`.`status` = 2 group by `product_information`.`product_id`;

utf8mb4_general_ci;



